import React,{Component} from 'react';
import './App.css';
import Intro from '../Intro';
import { render } from '@testing-library/react';

function App() {

  const state = {
    series:[]
  }

  const compdidMount=()=>{
    const series = ["Vikings","Money Hiest","TheFlash"];
    setTimeout(()=>{
      this.setState({ series });
    },2000);
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">TV series</h1>
      </header>
      <Intro message=" here is our new app"/>
      this length of the series is {this.state.series.length}
    </div>
  );

}

export default App;
